import React from "react"

const data = ["https://picsum.photos/id/1/200/300", "https://picsum.photos/200/200", "https://picsum.photos/200/300", "https://picsum.photos/300/200", "https://picsum.photos/200/400",
    "https://picsum.photos/id/2/200/200", "https://picsum.photos/id/10/200/250"]

const Photo = (props) => {
    return(
        <img className="images" alt="" src={data[props.index]}/>
    )
}


export default function Gallery(){
    console.log("wsh alors")
    return(
        <div id="images-wrapper">
            {/* <ul> */}
            {
                data.map((photo, index) => {
                    return(
                        <Photo index={index}/>
                    )
                })
            }   
            {/* </ul> */}

        </div>
    )
}
